/*
A chef has collected data on the satisfaction level of his n dishes. Chef can cook any dish in 1 unit of time.

Like-time coefficient of a dish is defined as the time taken to cook that dish including previous dishes multiplied by its satisfaction level  i.e.  time[i]*satisfaction[i]

Return the maximum sum of Like-time coefficient that the chef can obtain after dishes preparation.

Dishes can be prepared in any order and the chef can discard some dishes to get this maximum value.

 

Example 1:

Input: satisfaction = [-1,-8,0,5,-9]
Output: 14
Explanation: After Removing the second and last dish, the maximum total Like-time coefficient will be equal to (-1*1 + 0*2 + 5*3 = 14). Each dish is prepared in one unit of time.
Example 2:

Input: satisfaction = [4,3,2]
Output: 20
Explanation: Dishes can be prepared in any order, (2*1 + 3*2 + 4*3 = 20)
Example 3:

Input: satisfaction = [-1,-4,-5]
Output: 0
Explanation: People don't like the dishes. No dish is prepared.
Example 4:

Input: satisfaction = [-2,5,-1,0,3,-3]
Output: 35
 

Constraints:

n == satisfaction.length
1 <= n <= 500
-10^3 <= satisfaction[i] <= 10^3
*/

// naive
var maxSatisfaction = function (satisfaction) {
  console.log(satisfaction.length);
  satisfaction.sort((a, b) => a - b);
  if (satisfaction[satisfaction.length - 1] <= 0) return 0;

  let max = Number.MIN_SAFE_INTEGER;
  let next = satisfaction.reduce((total, val, time) => total + val * (time + 1), 0);
  let min = 0;

  while (next > max) {
    max = next;
    min += 1;
    next = 0;
    for (let i = min; i < satisfaction.length; i += 1) {
      next += (i - min + 1) * satisfaction[i];
    }
  }

  return max;
};

// realizing removing 1 dish reduces the negatives / positives by their respective sums
var maxSatisfaction = function (satisfaction) {
  satisfaction.sort((a, b) => a - b);
  if (satisfaction[satisfaction.length - 1] <= 0) return 0;

  let sumOfNegatives = 0;
  let sumOfPositives = 0;
  let max = satisfaction.reduce((total, val, time) => {
    sumOfNegatives += val * (val < 0);
    sumOfPositives += val * (val > 0);
    return total + val * (time + 1)
  }, 0);

  sumOfNegatives *= -1;

  let currNeg = 0;
  while (sumOfNegatives > sumOfPositives) {
    max += sumOfNegatives - sumOfPositives;
    sumOfNegatives += satisfaction[currNeg];
    currNeg += 1;
  }

  return max;
};

// keeping a running sum
var maxSatisfaction = function (satisfaction) {
  satisfaction.sort((a, b) => b - a);

  let max = 0;
  let currentIdx = 0;
  let currentBalance = satisfaction[currentIdx];

  while (currentBalance > 0 && currentIdx < satisfaction.length) {
    max += currentBalance;
    currentIdx += 1;
    currentBalance += satisfaction[currentIdx];
  }

  return max;
};

